Naughty housewife Chanel Preston was caught in a compromising threesome with the pool boy and gardener. Her husband witnessed the entire act, and he's filing for divorce. The only person Chanel can turn to is her best bosomy friend and lawyer Nikki Benz, her only hope in making sure she does not lose everything in the settlement! Nikki has this case under control, but she's more concerned with Chanel's well-being and most importantly her transition back to slutty singlehood. She gathers their closest girlfriends for some rest and relaxation, but it turns into a wild girls' trip to Cougarville, a resort where the young men are plentiful and the sex never stops!
